import { AppComponent } from './app.component';
import { r } from "@angular/router";
import { HttpClientModule } from "@angular/common/http";
import { MongoComponent } from './mongo/mongo.component';  //Import

@NgModule({
  declarations: [
    AppComponent,
    MongoComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    HttpClientModule

  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
